  render() {
    console.log(this.props.data.product);
    console.log(window.location.href);
    return (
      <>
        <div>
          <div className="fullCard__container">
            <img />
            <div className="fullCard__info">
              <div className="fullCard__name"></div>
            </div>
          </div>
        </div>
      </>
    );
  }
}

export default graphql(LOAD_PRODUCT)(FullCard);
